import logo from "./logo.svg";
import "./App.css";
import Login from "./components/Login";
import { Route, Router, Switch } from "react-router-dom";
import GameForm from "./components/GameForm";

function App() {
	return (
		<Router>
			{/* <div className="App"> */}
				<Switch>
					<Route
						exact
						path="/"
						component={Login}
					/>
					<Route
						path="/create-game"
						component={GameForm}
					/>
				</Switch>
			{/* </div> */}
		</Router>
	);
}

export default App;
